import React from 'react'

function Profile({imagesrc, text, header}) {
  return (
    <div className='flex justify-around w-screen h-64 p-4 bg-neutral-200'>
        <img src={imagesrc} alt='img' className=''/>
        <div className='text-center mt-8'>
            <div className='text-3xl'>{header}</div>
            <p>{text}</p>
        </div>
    </div>
  )
}

export default Profile
